let cssmap = {
  "red" : [1,0,0,1],
  "yellow" : [1,1,0,1],
  "green" : [0,1,0,1],
  "teal" : [0,1,1,1],
  "purple" : [1,0,1,1],
  "orange" : [1,0.55,0.25,1],
  "brown"  : [0.7, 0.4, 0.3, 1],
  "white"  : [1.0,1.0,1.0,1.0],
  "black" : [0,0,0,1],
  "grey" : [0.7, 0.7, 0.7, 1.0]
};

function css2rgba(css) {
  css = css.toLowerCase().trim();

  let rgb = (r, g, b) => {
    return [r/255, g/255, b/255, 1.0];
  }

  let rgba = (r, g, b, a) => {
    let ret = rgb(r, g, b);
    ret[3] = a;
    return ret;
  }

  if (css.match("rgb")) {
    return eval(css);
  } else {
    return cssmap[css];
  }
}

window.css2rgba = css2rgba;
